import React from 'react';
import './App.css';
// import { Route, Routes } from 'react-router-dom';

import {HomePage} from './components/HomePage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Penn Buddy
        </p>
      </header>
      <HomePage />
    </div>
  );
}

export default App;
